    def neighbours1(node) -> List:  # a vector of integers of any leangth
        
        neighbours = []
        for i in range(len(node)):
            n = list(node)
            n[i] += 1
            neighbours.append(n)
            n = list(node)
            n[i] -= 1
            neighbours.append(n)
        return neighbours

    def neighbours2(node) -> List:  # weird values

        neighbours = []
        for i in range(len(node)):
            n = list(node)
            n[i] *= 2
            neighbours.append(n)
            if node[i] > 1:
                n = list(node)
                n[i] //= 2
                neighbours.append(n)

        return neighbours

    def neighbours3(node) -> List:  # sets

        if len(node) == 0:
            return [[0]]

        neighbours = []
        n = list(node)
        n.append(max(node) +1)
        neighbours.append(n)
        n = list(node)
        n.insert(0, min(node) -1)
        neighbours.append(n)
        n = list(node)
        n.remove(max(node))
        neighbours.append(n)
        if len(node) > 1:
            n = list(node)
            n.remove(min(node))
            neighbours.append(n)
        return neighbours

    doctest.testmod(verbose = True)